(15, '学号姓名统计', '&lt;p&gt;		&lt;/p&gt;&lt;p&gt;本系统用于实验室日常工作，目前有实验室通知，打印机纸张管理，进展报告提交与批示评论，计算机运行状况实时监测等功能，以后还会加入更多方便大家学习和工作的功能，有好的意见和建议也可以提出来。&lt;br/&gt;&lt;/p&gt;&lt;p style=&quot;white-space: normal;&quot;&gt;&lt;br/&gt;&lt;/p&gt;&lt;p style=&quot;white-space: normal;&quot;&gt;为合理使用本系统，需要给大家每人一个可登录的帐号。用学号登录是最合适的了，这里统计一下大家的学号和姓名，方便批量导入系统。&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;	&lt;/p&gt;', '["\\u5b66\\u53f7","\\u59d3\\u540d"]', 1, '124611172', '2014-08-30 17:48:46', '2014-08-01 00:00:00', '2014-09-30 00:00:00', 1);
